-- Name: TR_RideOrders_AfterInsert(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public."TR_RideOrders_AfterInsert"() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
 	v_supply_id  bigint;
 	v_total_trip_count int;
 	v_filtered_completed_trip_count int;
 	v_default_completion_rate numeric(3,2);
 	v_threshold_trip_count int;
 	v_calculated_completion_rate numeric(3,2);
 	v_filtering_limit int;
BEGIN
	--Variable value assignment--
	v_supply_id = new.supply_id;
	v_default_completion_rate = .85;
	v_threshold_trip_count = 100;
	v_filtering_limit = 100;

	select count(ro.supply_id) into v_total_trip_count
		from public.ride_orders ro where ro.supply_id = v_supply_id;
	
	--- 2 cases. One for below threshold trips and vice versa ---
	if v_total_trip_count < v_threshold_trip_count then
		UPDATE public.supply_details 
			SET total_trips = v_total_trip_count,
			    completion_rate = v_default_completion_rate
			WHERE supply_id =  v_supply_id;

	else
		--select count(ro.supply_id) into v_completed_trip_count
			--from public.ride_orders ro where ro.supply_id = v_supply_id AND ro.status = 'COMPLETED';
		select count(filtered_data.supply_id) into v_filtered_completed_trip_count
		from
			(select * from public.ride_orders ro where ro.supply_id = v_supply_id order by time_stamp desc limit v_filtering_limit) as filtered_data 
		
		where 
			filtered_data.status = 'COMPLETED';				
		v_calculated_completion_rate = ( cast(v_filtered_completed_trip_count as decimal) / v_filtering_limit );
		raise notice 'v_filtered_completed_trip_count: %', v_filtered_completed_trip_count;	
		raise notice 'v_filtering_limit: %', v_filtering_limit;	
		raise notice 'v_calculated_completion_rate: %', v_calculated_completion_rate;
		
		UPDATE public.supply_details 
			SET total_trips = v_total_trip_count,
			    completion_rate = v_calculated_completion_rate
			WHERE supply_id =  v_supply_id;
	end if;
	return new;
END
$$;


