--
-- Name: rider_completion_rate(bigint); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.rider_completion_rate(v_supply_id bigint) RETURNS json
    LANGUAGE plpgsql
    AS $$
	declare 
		rider_rate_data JSON;

	begin
		SELECT to_json(r)
		into rider_rate_data
		FROM (
			WITH rider_details AS (
			        select sd.supply_id,sd.completion_rate
						from public.supply_details sd
						where sd.supply_id = v_supply_id)
			select 
				rd.completion_rate, nm.message_body as message
			FROM 
				rider_details rd, public.notification_messages nm 
			WHERE   nm.rate_range_start <= rd.completion_rate
			        AND nm.rate_range_end >= rd.completion_rate
		) r;
		return rider_rate_data;

	END;
$$;


